;; gorilla-repl.fileformat = 1

;; **
;;; Single pendulum data (in small angle approximation)
;; **

;; @@
(use 'gorilla-plot.core)
(use '[gorilla-repl table html])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def theta0 0.15) ;rads
(def grav-acc 9.8) ;ms-1
(def length 7.5) ;m

(def domain-step 0.25)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/domain-step</span>","value":"#'user/domain-step"}
;; <=

;; @@
(def theta (doall (map (fn [t] 
                         [t (* theta0 (Math/cos (* (Math/sqrt (/ grav-acc length)) t)))]) 
                       (range 0 15 domain-step))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/theta</span>","value":"#'user/theta"}
;; <=

;; @@
(def theta-dot (doall (map (fn [t]
                             [t (* -1 (Math/sqrt (/ grav-acc length)) theta0 (Math/sin (* (Math/sqrt (/ grav-acc length)) t)))])
                           (range 0 15 domain-step))))          
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/theta-dot</span>","value":"#'user/theta-dot"}
;; <=

;; @@
(def theta-double-dot (doall (map (fn [t]
                                    [t (* -1 (/ grav-acc length) theta0 (Math/cos (* (Math/sqrt (/ grav-acc length)) t)))])
                                  (range 0 15 domain-step))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/theta-double-dot</span>","value":"#'user/theta-double-dot"}
